	public void createGenericDoctor(String id) {
		DoctorPage doctorPage = mainPage.getDoctorPage();
		doctorPage.addDoctor("Doctor", "Tor", "12345678", "Cédula de ciudadanía", id);
		doctorPage.goHome();
	}

	public void createGenericPatient(String id) {
		PatientPage patientPage = mainPage.getPatientPage(); 
		patientPage.addPatient(id, "Paciente", "Ente", "12345678", "Cédula de ciudadanía", true);
		patientPage.goHome();
	}

	@Test
	public void scheduleAppointmentTestDateBefore() throws InterruptedException {
		String doctorId = "1234568";
		String patientId = "123456";
		String comment = "Cita Medicina General";
		createGenericDoctor(doctorId);
		createGenericPatient(patientId);
		
		ScheduleAppointmentPage scheduleAppointmentPage = mainPage.getScheduleAppointmentPage();
		scheduleAppointmentPage.scheduleAppointment(doctorId, patientId,Util.getDayBefore(), comment);
		List<String> errorMessages = scheduleAppointmentPage.getErrorMessages();
		Assert.assertNotNull(errorMessages);
		boolean found = false;
		for (String string : errorMessages) {
			if (string.toUpperCase().contains("FECHA")) {
				found = true;
				break;
			}
		}
		Assert.assertTrue(found);
	}

